import React from "react";
import ShowAnime from './ShowAnime.js';
import "./AnimeBox.css";
//will be used as next page to list
function AnimeOut(){
    return(
        <div className="anime">
            <div>
                <h1>Recommended</h1>
            </div>
            <ShowAnime 
            name="Test Anime" 
            image="[image]" 
            genre= "action, adventure, tragedy, drama" 
            studio="New Studio"/>
            <ShowAnime 
            name="Test Anime 2" 
            image="[image]" 
            genre= "action, adventure, tragedy, drama" 
            studio="New Studio"/>
        </div>
    );
}

export default AnimeOut;
